INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(0, 'SELECT COURSE', 'NULL', 0, 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', NULL, NULL, NULL),
(1, 'Udemy', 'Udemy is a platform that allows instructors to build online courses on their preferred topics. Using Udemy\'s course development tools, they can upload videos,etc.', 9.8, 'Best for Different Topic Choices', '1.Huge variety of Courses                                           \n   \n   \n   \n 2.Easy to navigate\n3. No technical issues\n4. Seems to care about its users', '1. Pricing can be confusing\r\n2. A bit dry in the feedback department', 'Begineer to Advanced', 'Available', '35M', 4.8, 'Yes', '7 days', 'Paid', 'Available', 'Video Material, Written Material, Quizzes', 'Good', 123, , 'https://www.udemy.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(2, 'Coursera', 'Prepare and practice for the SAS Certified Specialist: Base Programming Using SAS 9.4 Exam. Master the skills required for the SAS Base Programming Specialist Certification exam.\r\n\r\n', 8.6, 'Best for Career Paths', '1. Professional service\r\n2. Flexible timetables\r\n3. A variety of features to choose from\r\n4. You can get a degree', '1. Pricey\r\n2. Some instructors are extremely camera-shy\r\n3. Courses could be a bit diffult for absolute begineers', 'Begineer to Advanced', 'Available', '45M', 4, 'Yes', '7 days', 'Paid', 'Available', 'Gamified Courses, Written Material', 'Best', 200, , 'https://www.coursera.org/in');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(3, 'Skillshare', 'Skillshare is an online learning platform with thousands of creative courses and classes taught by experts to help you learn new skills. Get Access To Thousands of Inspiring Classes and the Support of a Creative Community.', 8.5, 'Best for Career Paths or Personal Improvement', '1. User-friendly interface\r\n2. Straightforward interface\r\n3. Plenty of courses to choose from\r\n4. Unique features', '1. Pricing problems\r\n2. The video player could be better (annoying comments / timestamps)', 'Beginner to Advanced', 'Available', '5M', 4, 'Yes', '15 days', 'Paid', 'Available', 'Online Video Classes, Written Material', 'Better', 150, , 'https://www.skillshare.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(4, 'Codecademy', 'Discover, Transform and Unlock New Skills with Codecademy Online Course. Learning to Code Shouldn\'t Be Painful. Start Your Coding Journey with Codecademy ', 8, 'Best for Learning to Code', '1. Easy to use and navigate\r\n2. Has a few different plans, including a free one\r\n3. One of the best places online to learn how to code', '1. The technical side of things could use some improvement\r\n2. Free courses are too general\r\n3. Sometimes, its tough to find relevant information', 'Beginner to Advanced', 'Available', '24M', 3.8, 'No', '7 days', 'Paid', 'Available', 'Video Material', 'Good', 200, , 'https://www.codecademy.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(5, 'Pluralsight', 'Pluralsight is the technology workforce development company that helps teams know more and work better together with stronger skills, improved processes and informed leaders. With projects and interactive courses, you can new skills in a risk-free environment and get guided feedbackso you can make mistakes before they matter.The best way to start learning is to see where your skills stand first. Take a quick skill assessment to uncover your strengths and weaknesses and get personalized recommendations on what to work on.   \n\n\n', 7.9, 'Best for Learning IT or Software Development & Bus', '1. Plenty of unique features\r\n2. Quality courses\r\n3. Fair pricing\r\n4. Industry veterans', '1. Some UI seems to be a bit clunky\r\n2. No free version - only a 10-day free trial', 'Beginner to Advanced', 'Not available', '1M', 4, 'Yes', '10 days', 'Paid', 'Available', 'Video Meterial, Written Material, Instructor Notes', 'Good', 10, , 'https://www.pluralsight.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(6, 'Thinkific', 'Create, market, and sell your own online courses. Thinkifics powerful, all-in-one platform makes it easy to share your knowledge, grow your audience, and scale the business you already love. ', 7.9, 'Best for Learning to Code', '1. Easy to use and navigate\r\n2. 1-on-1 learning model\r\n3. A guaranteed job position', '1. Unhelpful support\r\n2. High pricing\r\n3. Some mentors are incompetent', 'Beginner to Advanced', 'Available', '2.2 M', 4.4, 'No', '15 days', 'Free', 'Not Available', 'Video Material, Written Material', 'Best', 50, , 'https://www.thinkific.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(7, 'Lynda.com', 'LinkedIn Learning is an American massive open online course provider. It provides video courses taught by industry experts in software, creative, and business skills.', 8.2, 'Best for Learning Different Topics', '1. Easy to use\r\n2. Cheap prices\r\n3. Fun and inviting interface\r\n4. Desktop app for offline learning', '1. Some courses are outdated\r\n2. Course pages could do with an overhaul\r\n3. Some courses are dragged out', 'Beginner to Advanced', 'Available', '9.5M', 4.1, 'Yes', '1 month', 'Paid', 'Available', 'Video Material, Written Material', 'Better', 40, , 'https://www.linkedin.com/learning/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(8, 'Udacity', ' Udacity Nanodegree programs represent collaborations with our industry partners who help us develop our content and who hire many of our program graduates.', 9.6, 'Best for Starting Online Learning', '1. Simplistic design (no unnecessary information)\r\n2. High-quality courses (even the free ones)\r\n3. Variety of features', '1. A huge leap in prices\r\n2. Lack of customer support (in some cases)\r\n3. Lack of a community', 'Beginner to Advanced', 'Available', '11.5M', 4.8, 'No', '1 month', 'Free', 'Not Available', 'Video Material', 'Best', 50, , 'https://www.udacity.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(9, 'Edx', 'EdX is a non-profit created by founding partners Harvard and MIT. We\'re bringing the best of higher education to students around the world. ', 9.1, 'Best for Learning New Skills & for Developing a Career', '1. Well-established in the industry\r\n2. A wide range of features to choose from\r\n3. University-level courses\r\n4. Easy to navigate', '1. Some courses have a hefty price tag\r\n2. The platform tends to crash', 'Beginner to Advanced', 'Not available', '24M', 4.3, 'Yes', '15 days', 'Paid', 'Available', 'Video Material, Written Material', 'Good', 15, , 'https://www.edx.org/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(10, 'DataCamp', 'DataCamp is a leading online learning platform providing courses and tutorials on topics like data science and R programming across the world. ', 9.4, 'Best for Students', '1. Easy to use\r\n2. Offers quality content\r\n3. Very transparent with their pricing\r\n4. The price matches the quality\r\n5. Beginner-friendly', 'Free users get a relatively small amount of courses and other content', 'Beginner to Advanced', 'Not available', '90K', 4.2, 'No', '7 days', 'Free', 'Not Available', 'Slides, Video Material', 'Good', 20, , 'https://www.datacamp.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(11, 'Linkedin', 'LinkedIn Learning helps develop talent and keep vital business skills current with engaging online training and courses', 8.4, 'Best for Career Paths', '1. Professionally made\r\n2. Easy to use\r\n3. Nice features', '1. No accredited certification\r\n2. No pricing options (only a monthly and an annual plans)\r\n3. Lack of specific course difficulties (not enough advanced level courses)', 'Beginner to Advanced', 'Available', '17M', 4.3, 'Yes', '2 months', 'Paid', 'Available', 'Video Material', 'Better', 90, , 'https://www.linkedin.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(12, 'Byju', 'BYJUS - The Learning App. Come fall in love with learning. See this content immediately after install.', 9.7, 'Best for Competitive Exams', '1. One to one interaction\r\n2. Easy algorithm\r\n3. User friendly\r\n4. Easy to communicate with teachers', '1. Pricing differs\r\n2. No accredited certification', 'Beginner to Advanced', 'Available', '102M', 4.8, 'Yes', '1 month', 'Paid', 'Available', 'Live Sessions, Written Material', 'Best', 200, , 'https://byjus.com/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(13, 'Unacademy', 'The Unacademy App is a complete solution for all your learning needs. Learn for 100+ subjects from the comfort of your home. ', 9.2, 'Best for Career Paths or Personal Improvement', '1. 100% free\r\n2. Good and reputable content\r\n3. A wide variety of courses to choose from\r\n4. No ads', '2. Could have more courses on certain specific topics\r\n1. Some visual improvements would be great', 'Beginner to Advanced', 'Not available', '80M', 4.6, 'Yes', '1 month', 'Paid', 'Available', 'Video Material, Written Material', 'Good', 160, , 'https://unacademy.com/goal/gate-ese/PESHE');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(14, 'Great Learning', ' Great Learning is Indias leading professional learning platform, with a mission to make professionals proficient and future-ready. ', 7.4, 'Best for Improving Various Skills', '1. Simple and easy to use and navigate\r\n2. Professionally made courses taught by experts of the topic\r\n3. Great mobile support', '1. Might be a bit pricey to some students (based on multiple user reviews)\r\n2. Could improve on some design areas (namely - the course landing pages', 'Beginner to Advanced', 'Available', '40M', 4.5, 'No', '1 month', 'Free', 'Not Available', 'Video Material', 'Best', 140, , 'https://www.greatlearning.in/');
INSERT INTO `eplatform` (`epno`, `epname`, `epdesc`, `overall_score`, `best_for`, `pros`, `cons`, `course_level`, `course_rec_eng`, `no_of_users`, `value_for_money`, `offline_courses`, `free_trial`, `certificates`, `spec`, `learn_mat`, `cust_support`, `free_courses`, `image`, `link`) VALUES
(15, 'Alison', 'ALISON is a free online education platform that mostly focuses on workplace-based skills.', 6.9, 'Best for Job-applicable Skills', '1. Free courses\r\n2. Easy to use\r\n3. Good content\r\n4. A wide variety of courses to choose from', '1. Pay in order to remove ads\r\n2. Might not work for iOS users', 'Beginner to Advanced', 'Available', '76K', 4.3, 'No', '7 days', 'Paid', 'Available', 'Video Material, Written Material', 'Good', 30, , 'https://alison.com/');
